// FetchDataPage.js

import React, { useState } from 'react';
import { Table } from 'react-bootstrap';

const FetchDataPage = () => {
  const [criteria, setCriteria] = useState({
    name: '',
    school: '',
    week: '',
  });
  const [fetchedData, setFetchedData] = useState('');

  const handleFetchData = async () => {
    try {
      const queryParams = new URLSearchParams(criteria);
      const response = await fetch(`/api/entries?${queryParams}`);
      const result = await response.json();

      if (result.length > 0) {
        setFetchedData(JSON.stringify(result, null, 2));
      } else {
        setFetchedData('No data available');
      }

      console.log(result);
    } catch (error) {
      console.error('Error fetching data:', error);
    }
  };

  return (
    <div>
      <h2>Fetch Data</h2>
      <label>Search Term:</label>
      <input type="text" value={searchTerm} onChange={(e) => setSearchTerm(e.target.value)} />
      <button onClick={handleFetchData}>Search</button>

      {fetchedData.length > 0 ? (
        <Table striped bordered hover>
          <thead>
            <tr>
              <th>Name</th>
              <th>Week</th>
              <th>School</th>
              <th>Staff Name</th>
              <th>Competencies Met</th>
            </tr>
          </thead>
          <tbody>
            {fetchedData.map((entry) => (
              <tr key={entry._id}>
                <td>{entry.name}</td>
                <td>{entry.week}</td>
                <td>{entry.school}</td>
                <td>{entry.staffName}</td>
                <td>{entry.competenciesMet}</td>
              </tr>
            ))}
          </tbody>
        </Table>
      ) : (
        <p>No data available</p>
      )}
    </div>
  );
};

export default FetchDataPage;
